(13,'LIBRETA DE OFICIOS (OFICIAL)','<p>Libro a nivel de la secretaria general de la sala.</p>\r\n<p>En libros de primera instancia se han generado tickets debido al consecutivo de libros, pues éste no siempre les coincide con el número de oficio.</p>\r\n<p>Al momento de hacer la implementación de éste libro sería conveniente establecer si el sistema les debe proporcionar el consecutivo siguiente para que éste sea usado como número de oficio o bien, si es al contrario y primero escriben el oficio y luego lo registran en el Sistema. La segunda opción puede generar problemas por duplicados debido a que mientras un usuario escribe un oficio, otro puede intentar registrar uno con el mismo número progresivo.</p>\r\n<p>20170929 DEGT indicó que el NÚMERO DE OFICIO no es consecutivos del sistema, es campo abierto de texto.</p>.<br/>El expediente es opcional',1,0,'LIBRETA DE OFICIOS','lsc11','lsc11s','2','2s',14,'images/open_icon_library-standard/icons/png/16x16/actions/address-book-new.png','images/open_icon_library-standard/icons/png/48x48/actions/address-book-new.png','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"1\",\"generate_site_layout_blog\":\"1\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"1\",\"generate_plugins_search\":\"1\",\"generate_plugins_finder\":\"1\",\"generate_plugins_itemnavigation\":\"1\",\"generate_plugins_vote\":\"1\",\"generate_plugins_pagebreak\":\"1\",\"generate_plugins_emailcloak\":\"1\",\"generate_plugins_loadmodule\":\"1\",\"generate_plugins_events\":\"1\",\"generate_modules\":\"1\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":