(14,'LIBRO DE REGISTRO DE AMPAROS (OFICIAL)','<p>El campo juzgado se refiere al juzgado de distrito, el campo expediente es el expediente en el juicio de amparo.</p>\r\n<p>El campo quejoso está de más, pues deberá estár registrado en los campos torales, y podría ser capturado con un selector que liste todas las partes contenciosas. Aun así se dejará como campo de texto libre.</p>\r\n<p>20170929 DEGT indicó que el NÚMERO DE AMPARO no es consecutivos del sistema, es campo abierto de texto.</p>\r\n<p>20170929 DEGT indicó que el campo \"EXPEDIENTE\"  son campos de texto abierto.</p><br/>Este libro se distribuye por secretaría',1,0,'LIBRO DE REGISTRO DE AMPAROS','lsc12','lsc12s','2','2s',15,'images/open_icon_library-standard/icons/png/16x16/actions/address-book-new.png','images/open_icon_library-standard/icons/png/48x48/actions/address-book-new.png','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"1\",\"generate_site_layout_blog\":\"1\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"1\",\"generate_plugins_search\":\"1\",\"generate_plugins_finder\":\"1\",\"generate_plugins_itemnavigation\":\"1\",\"generate_plugins_vote\":\"1\",\"generate_plugins_pagebreak\":\"1\",\"generate_plugins_emailcloak\":\"1\",\"generate_plugins_loadmodule\":\"1\",\"generate_plugins_events\":\"1\",\"generate_modules\":\"1\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":