(15,'PAPELETAS PARA EL PRÉSTAMO DE EXPEDIENTES','<p>De implementarse campos torales vinculados se evitaría la recaptura y permitiría comprobar que la persona que solicita el préstamo tiene interés jurídico. Será de utilidad la implementación de diversas clasificaciones de interés jurídico diferentes a actor y demandado, como puede ser representante legal del actor, etc.</p>\r\n<p>Considero que sería de utilidad agregar también un campo para la captura de la imagen electrónica de la huella digital.</p>\r\n<p>20170929 la DEGT Está pendiente de definirse el libro de papeletas. Propongo que esté a nivel de presidencia de sala para que cualquier empleado del recinto pueda capturar.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170921 Quité el campo FECHA para combinarlo con el campo HORA</p>',1,0,'PAPELETAS PARA EL PRESTAMO DE EXPEDIENTES','lsc13','lsc13s','2','2s',16,'images/open_icon_library-standard/icons/png/16x16/actions/address-book-new.png','images/open_icon_library-standard/icons/png/48x48/actions/address-book-new.png','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"1\",\"generate_site_layout_blog\":\"1\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"1\",\"generate_plugins_search\":\"1\",\"generate_plugins_finder\":\"1\",\"generate_plugins_itemnavigation\":\"1\",\"generate_plugins_vote\":\"1\",\"generate_plugins_pagebreak\":\"1\",\"generate_plugins_emailcloak\":\"1\",\"generate_plugins_loadmodule\":\"1\",\"generate_plugins_events\":\"1\",\"generate_modules\":\"1\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"in