(318,'LIBRO DE PÓLIZAS Y FIANZAS (OFICIAL) - egresos','<p>Libro a nivel de la secretaria general de la sala.</p>\r\n<p>OJO éste libro se subdivide en dos, la primera de ellas a ingresos, la segunda subdivisión corresponde a egresos</p>\r\n<p>No es práctico hacer un sólo libro que muestre 2 formularios dependiendo de si es un ingreso o un egreso debido a que se creará confusión sobre cuando hacer un INSERT(ingreso) o un UPDATE (egreso)</p>\r\n<p> </p>\r\n<p>¿Existen relaciones entre el LIBRO DE PÓLIZAS Y FIANZAS (OFICIAL) y LIBRO DE EGRESOS (OFICIAL) y LIBRO DE CONTROL DE BILLETES Y PÓLIZAS (OFICIAL) y LIBRO DE MULTAS (OFICIAL) ? Una duda recurrente es sobre si se pueden relacionar las entradas y salidas de dinero y los billetes.</p>\r\n<p>¿Indican que lo llevan en dos tomos, es factible describirlo como dos libros con datos independientes que comparten la misma cuerda? De ser así se puede implementar como libros digitales independientes .</p>\r\n<p>Necesito ejemplos reales de números de certificado y números de poliza, ¿para cada número de certificado corresponde uno y sólo un número de poliza?</p>\r\n<p>Y si lo hacemos en un sólo libro sin subdivisiones unificando campos?</p>\r\n<p>Habilitaré el segundo campo toca, de ser necesario, cuando se aclare la logística</p>\r\n<p>Respuesta. Se hará en un sólo libro y enla edición se mostrará 2 formularios dependiendo de si es un ingreso o un egreso.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170922 Deshabilité el segundo campo TOCA y modifiqué el code_name porque daba problemas al compilar .</p>\r\n<p>20171109 No se dio seguimiento a las dudas planteadas, se generaron 2 libros, uno para ingresos y otro para egresos</p>',1,0,'LIBRO DE POLIZAS Y FIANZAS','lsc08e','lsc08es','2','2s',11,'images/open_icon_library-standard/icons/png/16x16/actions/address-book-new.png','images/open_icon_library-standard/icons/png/48x48/actions/address-book-new.png','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"1\",\"generate_site_layout_blog\":\"1\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"1\",\"generate_plugins_search\":\"1\",\"generate_plugins_finder\":\"1\",\"generate_plugins_itemnavigation\":\"1\",\"generate_plugins_vote\":\"1\",\"generate_plugins_pagebreak\":\"1\",\"generate_plugins_emailcloak\":\"1\",\"generate_plugins_loadmodule\":\"1\",\"generate_plugins_events\":\"1\",\"generate_modules\":\"1\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',0,'2017-08-19 19:39:21',1,'','2017-11-09 18:50:02',1,0,'0000-00-00 00:00:00',10,8);
INSERT INTO `jos_componentarchitect_components` VALUES (1,'TSJ CDMX Libros txCA','<ul>\r\n<li class=\"standard\">El objetivo del componente es sustituir los libros físicos que se utilizan en los órganos jurisdiccionales del TSJ CDMX por libros virtuales.</li>\r\n<li class=\"standard\">Debido a la gran cantidad de código que se producirá en CA había decidido generar un componente por materia y un componente adicional para administrar los objetos de apoyo, como son los objetos anidados. No funcionó adapatar sistemas de nombres, se generará mucho más ruido. Todo en un solo componente.</li>\r\n<li class=\"standard\">Quieren formularios continuos, son reticentes con las ventanas modales que se utilizan con los objetos anidados.</li>\r\n<li class=\"standard\">Actualmente \"persons\" es un elemento no anidado, pero me gustaría convertirlo en anidado para hacer más limpio el código.</li>\r\n<li class=\"standard\">Para cumplir con la burocrácia CA la clave del libro la utilizaré como singular y +s para el plural. He renombrado las tablas, pero he conservado el prefijo jtl_{clave}s para conservar compatibilidad con otras reglas que pueda haber.</li>\r\n<li class=\"standard\">Otros libros que les faltaría el campo a plural son:</li>\r\n</ul>\r\n<p style=\"padding-left: 60px;\">dil_jccm07<br />dil_jccm09<br />dep_joc03<br />incul_jpdng01<br />ofen_jpdng01 <br />decl_jpdng01<br />dili_jpdng09<br />firm_jpdng17<br />adol_jjadg05<br />firm_jjadg16<br />adol_jjadg01 <br />averiguacion<br />personaliasedad<br />personedadsexo<br />persondelito<br />personalias<br />jempleado_bb <br />address</p>\r\n<p style=\"padding-left: 60px;\"> </p>\r\n<div class=\"standard\">El objetivo del componente es sustituir los libros físicos que se utilizan en los órganos jurisdiccionales del TSJ CDMX por libros virtuales.</div>\r\n<div class=\"standard\">En el futuro se requerirá modificar los objetos y quitar el \"_s\" del code_name y agregar \"s\" al plural_code_name; y re-nombrar las tablas y vistas.</div>','caballeroantonio','1.0.0','caballeroantonio.com','caballeroantonio@hotmail.com','jt_ca','Copyright (c) 2017 - 2020. All Rights Reserved',1,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"0\",\"generate_categories_site_views_categories\":\"0\",\"generate_categories_site_views_category\":\"0\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"0\",\"include_alias\":\"0\",\"include_assetacl\":\"1\",\"include_assetacl_record\":\"0\",\"include_batch\":\"0\",\"include_checkout\":\"0\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"0\",\"include_featured\":\"0\",\"include_hits\":\"0\",\"include_image\":\"0\",\"include_intro\":\"0\",\"include_language\":\"0\",\"include_metadata\":\"0\",\"include_microdata\":\"0\",\"include_modified\":\"1\",\"include_name\":\"0\",\"include_ordering\":\"1\",\"include_params_global\":\"0\",\"include_params_menu\":\"0\",\"include_params_record\":\"0\",\"include_published_dates\":\"0\",\"include_status\":\"1\",\"include_tags\":\"0\",\"include_urls\":\"0\",\"include_versions\":\"1\"}',1,'2017-08-19 19:34:58',1,'','2017-11-24 01:20:41',1,0,'0000-00-00 00:00:00',21,1),
(2,'TSJ CDMX Libros en Salas Civiles txCA','<div class=\"standard\">El objetivo del componente es sustituir los libros físicos que se utilizan en los órganos jurisdiccionales de Segunda Instancia Cívil del TSJ CDMX por libros virtuales.</div>\r\n<div class=\"standard\"> </div>\r\n<div class=\"standard\">CHANGELOG</div>\r\n<div class=\"standard\">20170919 Todos los field.filter = false para evitar SELECT DISCTINCT</div>\r\n<div class=\"standard\">20170919 se agregó FIELD_TYPE = expediente, name reemplaza expedienteFriendlyName</div>\r\n<div class=\"standard\">20170921 quitar \'PARTES DEL JUICIO\' (actor, demandado, otros) del nivel 1, add expediente de origen nivel 2, remove Expediente del nivel 1</div>\r\n<div class=\"standard\">20170921 se agregó validaciones a todos los campos fecha</div>\r\n<div class=\"standard\">20170922 se agregó FIELD_TYPE = firma, se cambiaron los campos al FIELD_TYPE {expediente|firma}</div>\r\n<div class=\"standard\"> </div>\r\n<div class=\"standard\">@ToDo</div>\r\n<div class=\"standard\">- Remover todas las \'PARTES DEL JUICIO\' libros y agregarlo en objeto expediente</div>\r\n<div class=\"standard\">- Generar modificar el objeto modal para que permita capturar id_expediente, id_expediente_origen, elegir un expediente en de éste órgano y un expediente de origen de otro organo.</div>\r\n<div class=\"standard\">- Permitir registrar: AUTORIZADO POR QUÉ PARTE, PARTE ACTORA, PARTE DEMANDADA</div>\r\n<div class=\"standard\">Add key to id_expediente, field.filter = false quita TABLE.KEY</div>\r\n<div class=\"standard\">\r\n<p>Make expediente de origen, read only on 1ra instancia</p>\r\n</div>','caballeroantonio','1.0.0','caballeroantonio.com','caballeroantonio@hotmail.com','jtsc_ca','Copyright (c) 2017 - 2020. All Rights Reserved',3,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"0\",\"generate_categories_site_views_categories\":\"0\",\"generate_categories_site_views_category\":\"0\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"0\",\"include_alias\":\"0\",\"include_assetacl\":\"1\",\"include_assetacl_record\":\"0\",\"include_batch\":\"0\",\"include_checkout\":\"0\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"0\",\"include_featured\":\"0\",\"include_hits\":\"0\",\"include_image\":\"0\",\"include_intro\":\"0\",\"include_language\":\"0\",\"include_metadata\":\"0\",\"include_microdata\":\"0\",\"include_modified\":\"1\",\"include_name\":\"0\",\"include_ordering\":\"1\",\"include_params_global\":\"0\",\"include_params_menu\":\"0\",\"include_params_record\":\"0\",\"include_published_dates\":\"0\",\"include_status\":\"1\",\"include_tags\":\"0\",\"include_urls\":\"0\",\"include_versions\":\"1\"}',1,'2017-08-19 19:34:58',1,'','2017-11-04 01:36:45',1,0,'0000-00-00 00:00:00',46,8),
